import "./styles.scss";
import { Link, Route, Routes } from "react-router-dom"; //BrowserRouter isn't required because it exists in index.js
import HomePage from "./HomePage";
import ViewAppointment from "./ViewAppointment";
import Header from "./Header";
import Footer from "./Footer";
import Login from "./Login";
import Registration from "./Registration";
import CreateAppointment from "./CreateAppointment";
import UserButton from "./UserButton";
import ViewMedRecord from "./ViewMedRecord";
import PatientRecords from "./PatientRecords";
import UserChoice from "./UserChoice";
import { useState } from "react";

interface Props {
  /*links: string[];
  labels: string[];
  routes: React.ReactElement[];*/
  returnType: string;
  passLinks: (links: string[]) => void;
  passLabels: (labels: string[]) => void;
  passRoutes: (routes: React.ReactElement[]) => void;
}

const ReturnNavArray = (props: Props) => {
  let { returnType } = props;

  if (returnType === "Patient") {
    props.passLinks(["/", "/viewMed", "/reg", "/viewApp", "/createApp"]); //This array contains the paths to elements
    props.passLabels([
      "Home",
      "View Medical Record",
      "Registration",
      "View and Cancel Appointments",
      "Create Appointment",
    ]); //This array contains the labels of the header links
    props.passRoutes([
      <HomePage />,
      <ViewMedRecord />,
      <Registration />,
      <ViewAppointment />,
      <CreateAppointment />,
    ]);
  }

  return (
    <>
      <button className="govuk-button" data-module="govuk-button">
        Submit
      </button>
    </>
  );
};

export default ReturnNavArray;
